import React, { useEffect } from 'react'
import { Link } from 'react-router-dom'

const Tracks = props => {
    console.log(props.location.state.list)
    props.history.push({
        state: {
            history: props.location.state.list.id, 
            cachedPlaylist: props.location.state.playlist
        }
      })
    console.log(props.location.state)
    useEffect(() => {

    }, [])
    return (
        
        <div>
            {props.location.state.list ? <div>racks!
            Linked here by {props.location.state.list.name}
            <Link to={"/main/"}> Go back </Link> </div> : <div/> }

        </div>
    )
}

export default Tracks
